import styles from './styles.module.css'

export const Users = () => {
    const data = []

    for (let i=0; i< 100; i++) {
        data.push({'Наименование': 'UM System Group',
        "E-mail": 'example@mail.ru',
        "Телефон": '+77007007070',
        "Роль": 'admin',
        "Франшиза": 'Шымкент, Сарыагаш',
        "баланс": '250000'})
    }

    const headers = ['#'].concat(Object.keys(data[0]))

    const columns = [{
        width: '200px'
    }]
    
    return (
        data
        ? <div className={styles.table}>
            <div className={styles.table_header}>
                {headers.map((el, idx) => {
                    return (
                        <div key={idx} className={styles.table_title}>{el.toUpperCase()}</div>
                    )
                })}
            </div>
            <div className={styles.table_content}>
                {data.map((el, idx) => {
                    const cellsValues = Object.values(el);

                    return (
                        <div className={styles.table_row}>
                            <div className={styles.table_cell}>{idx+1}</div>
                            {cellsValues.map((cell) => {
                                return <div className={styles.table_cell} style={columns[0]}>{cell}</div>
                            })}
                        </div>
                    )
                })}
            </div>
        </div>
        : <div>no data</div>
    )
}
